import gymImage from '../assets/images/typeIcons/gym.png';
import studiesImage from '../assets/images/typeIcons/studies.png';
import origamiImage from '../assets/images/typeIcons/origami.png';
import foodImage from '../assets/images/typeIcons/food.png';
import businessImage from '../assets/images/typeIcons/business.png';
import homeImage from '../assets/images/typeIcons/home.png';
import ideaImage from '../assets/images/typeIcons/idea.png';
import travelImage from '../assets/images/typeIcons/travel.png';
import watchImage from '../assets/images/typeIcons/watch.png';
import petImage from '../assets/images/typeIcons/pet.png';
import workImage from '../assets/images/typeIcons/work.png';


export const tasksArray = [
    [ 0, eval(new String('studiesImage')), 'Finalizar atividade de cáculo II', '#4E7BFC'],
    [ 1, eval(new String('origamiImage')), 'Decorar parede do quarto', '#5ED285'],
    [ 2, eval(new String('foodImage')), 'Comprar maça para fazer a torta', '#FD3030'],
    [ 3, eval(new String('businessImage')), 'Pagar boleto da fatura do cartão', '#FD5530'],
    [ 4, eval(new String('homeImage')), 'Comprar nova lampada', '#7C78FD'],
    [ 5, eval(new String('ideaImage')), 'Criar uma planilha para controle financeiro', '#FDC130'],
    [ 6, eval(new String('travelImage')), 'Fazer as malas para viagem', '#74DEFF'],
    [ 7, eval(new String('watchImage')), 'Entrar em contato com cliente X', '#D4A269'],
    [ 8, eval(new String('petImage')), 'Passear com o Bob', '#90FF74'],
    [ 9, eval(new String('workImage')), 'Finalizar planilha de clientes', '#6F9379'],
    [ 10,eval(new String('gymImage')), 'Fazer exercicío físico', '#F05064'],
];
